import { BrowserRouter as Router, Switch, Route } from 'react-router-dom'
import LandingPage from './Pages/Landing_page';
import Video from './Pages/Video';
import './App.css';

function App() {
  return (
    <Router>
        <Switch>
            <Route path='/' strict component={LandingPage}/>
            <Route path='/educational-video' strict component={Video}/>
        </Switch>
    </Router>
  );
}

export default App;
